Fighter Pilot/Operation Red Flag (presented by BOEING in HDTV and IMAX)

This torrent has 3 .avi files of the making of the show, the  Operation Red Flag air show, and the actual movie Fighter Pilot/ Operation Red Flag. If you havent heard of or seen it, I would HIGHLY recommend it to anyone! Fighter pilots from around the world meet at the TOP GUN flight school to learn about and compete with other pilots from different countries. Definitley a great watch, and spectacular film making. Originally broadcast in Hi-Def, the .avi files in this torrent are VERY good quality!

PLEASE DONT FORGET TO SEED IF YOU DOWNLOAD! This is a hard movie to come by from what I've seen, so please SHARE once you download it, and of course, ENJOY!


